import React from 'react'
import { View, Text ,StyleSheet} from 'react-native'
import { Image } from 'react-native-elements';

const Categories = () => {
    return (
        <View style={{padding:10, display:'flex',flexDirection:'row'}}>
        <View style={{marginLeft:5,}}>
        <Image
          style={{width:200,height:200,borderRadius:10}}
          source={{uri: 'https://images.pexels.com/photos/3764353/pexels-photo-3764353.jpeg'}}
        />
        <Text style={{marginLeft:40, fontSize:20,fontWeight:'700'}}> Burger </Text>
        </View>
        <View style={{marginLeft:10,borderRadius:10}}>
        <Image
          style={{width:200,height:200}}
          source={{uri: 'https://images.pexels.com/photos/3764353/pexels-photo-3764353.jpeg'}}
        />
        <Text style={{marginLeft:40, fontSize:20,fontWeight:'700'}}> Burger </Text>
        </View>
      </View>
    )
}

const Styles = StyleSheet.create({

    container:{
        backgroundColor:"white"
    }

})

export default Categories
